times_repeated :: Char -> [Char] -> Int
times_repeated char string = length (filter (==char) string)
get_repeat_counts :: [Char] -> [Int]
get_repeat_counts string = [times_repeated char string | char <- string]
has_repeat :: Int -> [Char] -> Bool
has_repeat num string = elem num (get_repeat_counts string)
ids_with_two_repeats = [id | id <- ids, has_repeat 2 id]
ids_with_three_repeats = [id | id <- ids, has_repeat 3 id]
checksum = (length ids_with_two_repeats) * (length ids_with_three_repeats)